import React from 'react';
import {
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper,
    Typography
} from '@mui/material';
import { Task, CalendarTask } from '../types/graphTypes';

interface ResultsTableProps {
    tasks: (Task | CalendarTask)[];
    type: 'ranks' | 'calendar';
    criticalPath: string[];
}

const ResultsTable: React.FC<ResultsTableProps> = ({ tasks, type, criticalPath }) => {
    const getTableHeaders = () => {
        if (type === 'ranks') {
            return (
                <TableRow>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }}>Tâche</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }} align="right">Rang</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }} align="right">Marge</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }} align="right">Critique</TableCell>
                </TableRow>
            );
        } else {
            return (
                <TableRow>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }}>Tâche</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }} align="right">Date de début</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }} align="right">Date de fin</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }} align="right">Critique</TableCell>
                </TableRow>
            );
        }
    };

    const getTableRow = (task: Task | CalendarTask) => {
        const isCalendarTask = 'startDate' in task;

        if (!isCalendarTask) {
            return (
                <TableRow
                    key={task.id}
                    sx={{ 
                        backgroundColor: criticalPath.includes(task.id) ? '#FEB2B2' : 'inherit',
                        '&:hover': { backgroundColor: criticalPath.includes(task.id) ? '#FC8181' : '#EDF2F7' }
                    }}
                >
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: criticalPath.includes(task.id) ? 'bold' : 'normal' }}>{task.name}</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk' }} align="right">{task.rank}</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk' }} align="right">{task.margin}</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk' }} align="right">{task.isCritical ? 'Oui' : 'Non'}</TableCell>
                </TableRow>
            );
        } else {
            return (
                <TableRow
                    key={task.id}
                    sx={{ 
                        backgroundColor: criticalPath.includes(task.id) ? '#FEB2B2' : 'inherit',
                        '&:hover': { backgroundColor: criticalPath.includes(task.id) ? '#FC8181' : '#EDF2F7' }
                    }}
                >
                    <TableCell sx={{ fontFamily: 'NoiGrotesk', fontWeight: criticalPath.includes(task.id) ? 'bold' : 'normal' }}>{task.name}</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk' }} align="right">{task.startDate}</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk' }} align="right">{task.endDate}</TableCell>
                    <TableCell sx={{ fontFamily: 'NoiGrotesk' }} align="right">{task.isCritical ? 'Oui' : 'Non'}</TableCell>
                </TableRow>
            );
        }
    };

    return (
        <Paper elevation={2} sx={{ p: 2, my: 2 }}>
            <Typography variant="h6" gutterBottom sx={{ fontFamily: 'NoiGrotesk', fontWeight: 'bold' }}>
                {type === 'ranks' ? 'Rangs des tâches' : 'Calendrier des tâches'}
            </Typography>
            <TableContainer>
                <Table>
                    <TableHead>
                        {getTableHeaders()}
                    </TableHead>
                    <TableBody>
                        {tasks.map(task => getTableRow(task))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Paper>
    );
};

export default ResultsTable;
